import classes from './FormBtn.module.css';

const FormBtn = () => {
  return(
    <div className={classes.FormBtn}>
      <button className={classes.SignIn}></button>
      <button className={classes.SignUp}></button>
    </div>

  )
}
export default FormBtn;
